- input: "TEXT\x1CC00030718\x1C1\x1C\x1CF3XN\x1COn Line 21b of this report, the six
    contra disbursements, totaling $ 1,430.00, to National Association of Realtors
    in the amounts of: $130.00, $200.00, $250.00, $250.00, and $500.00 all dated 2/15/13,
    and one for $100.00 dated 2/16/13 reported and transferred to Line 23, the full
    purpose of disbursement should be noted as: In-Kind Facilitation of Earmarked
    Contributions.  These amounts relate to an original $8,000.00 advance payment
    made to the National Association of Realtors for future consulting and related
    services, which was made on 4/16/12 and reported on Line 21b of the May 2012 monthly
    report.   In the current February 2013 reporting period, this $1,430.00 is being
    applied to payment in connection with services provided to facilitate earmarked
    contributions to twenty seven separate committees as reflected on Line 23 of this
    report, as follows: 1) Transfer $500.00 from Line 21b to Line 23 attributable
    to services provided on 2/15/13 and deemed a contribution to the National Republican
    Congressional Campaign; 2) Transfer $250.00 from Line 21b to Line 23 attributable
    to services provided on 2/15/13 and deemed a contribution to the National Republican
    Senatorial Campaign; 3) Transfer $250.00 from Line 21b to Line 23 attributable
    to services provided on 2/15/13 and deemed a contribution to the Democratic Congressional
    Campaign Committee; 4) Transfer $200.00 from Line 21b to Line 23 attributable
    to services provided on 2/15/13 and deemed a contribution to the Democratic Senatorial
    Campaign Committee; 5) Transfer $130.00 from Line 21b to Line 23 attributable
    to services provided on 2/15/13 and deemed contributions to the following 13 committees
    in the amount of $10.00 each: Diane Black For Congress; Martin Heinrich For Congress;
    Bachmann For Congress; Richard E Neal For Congress Committee; Citizens For Waters;
    Jim Costa For Congress; Friends of Senator Carl Levin; Tim Johnson For South Dakota,
    Inc.; Volunteers For Shimkus; Ed Royce For Congress; Johanns For Senate Inc;  Friends
    of Lois Capps; & Simpson For Congress; 6) Transfer $100.00 from Line 21b to Line
    23 attributable to services provided on 2/16/13 and deemed contributions to the
    following 10 committees in the amount of $10.00 each: Levin For Congress; Blaine
    For Congress; Friends of Joe Heck; Van Hollen For Congress; Billy Long For Congress;
    \ Gutierrez For Congress; Amodei For Nevada; Mark Takano For Congress; Wyden For
    Senate; & Engel For Congress.   For Line 22 of this report, the disbursement to
    Louisiana RPAC for $900.00 on 2/14/13 represents a refund for a transmission of
    funds inadvertently sent in error by the state agent.\n"
